package_rei.addModule("math._hyper", ({modules})=>(a, n, b=a)=>{
    switch(n){
    case 0: return ++b;
    case 1: return a + b;
    case 2: return a * b;
    case 3: return a ** b;
    default: {
        if(b === 0)return 1;
        let prev = a;
        for(;--b;)
            prev = modules.math.hyper(a, --n, prev);
        return prev;
    }
    }
});
package_rei.addModule("math.hyper", ({modules})=>(a, n, b=a)=>{
    const stack = new modules.Stack();
    while(1){
        stack.push(modules.math._hyper);
        stack.execute();
    }
});

